// assets
import { IconBrandChrome, IconHelp } from '@tabler/icons';

// constant
const icons = { IconBrandChrome, IconHelp };

// ==============================|| SAMPLE PAGE & DOCUMENTATION MENU ITEMS ||============================== //

const other = {
    id: 'sample-docs-roadmap',
    type: 'group',
    children: [
        {
            id: 'backgrounds',
            title: 'Backgrounds',
            type: 'item',
            url: '/backgrounds',
            icon: icons.IconBrandChrome,
            breadcrumbs: false
        },
        {
            id: 'documentation',
            title: 'Demonstration',
            type: 'item',
            url: '/how_to',
            icon: icons.IconHelp,
            // breadcrumbs: false
            target: true
        }
    ]
};

export default other;
